// Library components

import { Grid, 
        InputAdornment,
        Typography,
        Fab,
        IconButton
} from '@mui/material'
import { CTextField } from './products/Products' 
import React from 'react'

// Icons
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import AddIcon from '@mui/icons-material/Add';
import DeleteOutlineOutlinedIcon from '@mui/icons-material/DeleteOutlineOutlined';

// Routes
import { useNavigate } from 'react-router-dom';
import { DataGrid } from '@mui/x-data-grid';



const Invoice = () => {
// Navigation
let NavS = useNavigate();


// Column header
const columns = [

  // ID Column
  { field: 'Product_ID', 
    headerName: 'ID', 
    width: 70 ,
    headerAlign: 'center',

    renderCell: (cellValues) => {
      return (
        <div
          style={{
            color: "black",
            fontSize: 18,
            width: "100%",
            textAlign: "center"
          }}
        >
          {cellValues.value}
        </div>
      );
    }
  },

  // ID Column
  { field: 'Product_name', 
    headerName: 'name', 
    width: 200,
    headerClassName: 'super-app-theme--header',
    headerAlign: 'center', 

    renderCell: (cellValues) => {
      return (
        <div
          style={{
            color: "black",
            fontSize: 18,
            width: "100%",
            textAlign: "center"
          }}
        >
          {cellValues.value}
        </div>
      );
    }
  
  },

  { field: 'Product_category', 
    headerName: 'category', 
    width: 130,
    headerAlign: 'center', 

    renderCell: (cellValues) => {
      return (
        <div
          style={{
            color: "black",
            fontSize: 18,
            width: "100%",
            textAlign: "center"
          }}
        >
          {cellValues.value}
        </div>
      );
    }

  
  },

  { field: 'Product_stocks', 
    headerName: 'stocks ', 
    width: 130,
    headerAlign: 'center', 

    renderCell: (cellValues) => {
      return (
      <div
      style={{
        color: "black",
        fontSize: 18,
        width: "100%",
        textAlign: "center"
        }}
      >
        {cellValues.value}
        </div>
        );
    }
  },

  { field: 'Product_price', 
    headerName: 'price', 
    width: 130,
    headerAlign: 'center', 

    renderCell: (cellValues) => {
      return (
        <div
          style={{
            color: "black",
            fontSize: 18,
            width: "100%",
            textAlign: "center"
          }}
        >
          {cellValues.value}
        </div>
      );
    }
  },
  
// delete
  {
    field: 'action',
    headerName: 'Action',
    width: 130,
    headerAlign: 'center', 
    renderCell: () => {
      return (
        <div
          style={{
            width: "100%",
            textAlign: "center",
            // marginRight: '2'
          }}
        >
         

        <IconButton color="primary" aria-label="delete">
            <DeleteOutlineOutlinedIcon/>
        </IconButton>
         

        </div>


      );
    }
  }

];


  return (
    <div>
      {/* Whole Container */}
        <Grid container spacing={2}>

{/* Search bar container */}
          <Grid item md={9} xs={12}>

            {/* Para may padding */}
           <Grid 
           container 
           padding={5}
           direction="row"
           justifyContent="center"
           alignItems="flex-start">

             {/* Search bar */}
              <CTextField 
              variant='standard' 
              fullWidth 
              placeholder='Searchbar'

              InputProps={{
                endAdornment: (
                  <InputAdornment position="start">
    
                    <SearchOutlinedIcon fontSize='large' />
                 
                  </InputAdornment>
                ),
              }}
              />
           </Grid>
    
          </Grid>

          {/* Conatainer button */}
          <Grid item md={3} xs={12}>

            {/* Container para may padding */}
            <Grid 
            container 
            padding={5}           
            direction="row"
            justifyContent="center"
            alignItems="flex-start">

              {/* Button add */}
              <Fab 
              color="primary" 
              variant='extended' 
              aria-label="add" 
              onClick={e=>NavS("/Mainpage/Products/AddItem")} 
              >
                <AddIcon />
                add data
              </Fab>

            </Grid>
            
          </Grid>



          {/* Container for table */}
          <Grid item md={12}>

            <Grid 
            container             
            direction="row"
            justifyContent="center"
            alignItems="flex-start"
            padding={5}>

            </Grid>

            <DataGrid
              columns={columns}
              // getRowId={(rows)=> rows.Product_ID}
              // rows={filtered} // data na pinasok yung data 
                  
              // pageSize={10}
              // onCellClick={delete_product}
            />

          </Grid>

        </Grid>
    </div>
  )
}

export default Invoice
